import Link from 'next/link';

const Navbar = () => {
  return (
    <nav>
      <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
        <style jsx>{`
          .link {
            margin-left: 15px;
          }
        `}</style>
    </nav>
  )
}

export default Navbar
